data = ""


def find_start(data, unique_count):
    buffer = []
    i = 0
    while len(set(buffer)) < unique_count:
        if len(buffer) == unique_count:
            buffer = buffer[1:] # Easy optimization to use deque, but this is plently fast
        buffer.append(data[i])
        i += 1
    return i


if __name__ == "__main__":
    print("Part 1:", find_start(data, 4))
    print("Part 2:", find_start(data, 14))

